wins = {'RaForest': 0, 'GVWY': 0, 'AA': 0, 'MIX': 0, 'ZIC': 0, 'ZIP': 0}
beats = {'RaForest': 0, 'GVWY': 0, 'AA': 0, 'MIX': 0, 'ZIC': 0, 'ZIP': 0}
dominates = {'RaForest': [], 'GVWY': [], 'AA': [], 'MIX': [], 'ZIC':[], 'ZIP': []}

for d in data:
    wins[d[0]] += d[2]
    wins[d[1]] += d[3]
    
    if d[2] > d[3]:
        beats[d[0]] += 1
        dominates[d[0]]+=[d[1]]
    else:
        beats[d[1]] += 1
        dominates[d[1]]+=[d[0]]


wins = dict(sorted(wins.items(), key=lambda x: x[1], reverse=True))
beats = dict(sorted(beats.items(), key=lambda x: x[1], reverse=True))

# Print the results_noise
print("\n")
print('Total number of wins for each trading algorithm:')
print(wins)
print('\nNumber of algorithms beaten by each trading algorithm:')
print(beats)
print('\nNumber of algorithms dominated by each trading algorithm:')
print(dominates)
